import React from 'react';

import {Icon , Input} from '../Atom';



function MoleculeInput(props) {
   
    
    return (
       <div className='inputContainer'><Input {...props} 
       className='input'/>
       
       <Icon {...props} 
       className='inputIcon'/>
       
       </div>
       
      
      
    );
};

export default MoleculeInput;
